import GiphyApp from './GiphyApp/GiphyApp'
import CounterHooks from './CounterHooks'
// import CounterMemo from './CounterMemo'

function App() {
  const someArray = [1, 2, 3, 4, 5]

  return (
    <div>
      {someArray.map((thing, index) => {
        return <CounterHooks key={index} />
      })}
      <CounterHooks />
    </div>
  )
}

export default App
